import React, { useState, useEffect } from 'react';

const DB_Modal = ({ showModal, onCloseModal }) => {
    const [data, setData] = useState(null);

    useEffect(() => {
        if (showModal) {
            setData('Hello Modal!');
        }
        else{
            return null;
        }
    }, [showModal]);

    return (
        <Modal isOpen={showModal} onClose={onCloseModal}>
            <>
                <h1>GFG</h1>
                <h3>A computer science portal!</h3>
            </>
        </Modal>
    );
};

export default DB_Modal;
